function reset() {

    var zoomDate = 0;

    switch ($('input[name=zoomSelector]:checked').prop("id")) {
        case "zoom_6h":
            zoomDate = Date.now() - 6 * 60 * 60 * 1000;
            break;
        case "zoom_24h":
            zoomDate = Date.now() - 24 * 60 * 60 * 1000;
            break;
        case "zoom_2d":
            zoomDate = Date.now() - 48 * 60 * 60 * 1000;
            break;
        case "zoom_4d":
            zoomDate = Date.now() - 96 * 60 * 60 * 1000;
            break;
        case "zoom_1w":
            zoomDate = Date.now() - 7 * 24 * 60 * 60 * 1000;
            break;
        case "zoom_2w":
            zoomDate = Date.now() - 14 * 24 * 60 * 60 * 1000;
            break;
        case "zoom_1m":
            zoomDate = Date.now() - 30 * 24 * 60 * 60 * 1000;
            break;
    }

    data = zoomData(initialData, new Date(zoomDate));

    var aggregatePeriod = 300;

    switch ($('input[name=candlestickSelector]:checked').prop("id")) {
        case "candlesticks_5m":
            aggregatePeriod = 5 * 60;
            break;
        case "candlesticks_15m":
            aggregatePeriod = 15 * 60;
            break;
        case "candlesticks_30m":
            aggregatePeriod = 30 * 60;
            break;
        case "candlesticks_2h":
            aggregatePeriod = 2 * 60 * 60;
            break;
        case "candlesticks_4h":
            aggregatePeriod = 4 * 60 * 60;
            break;
        case "candlesticks_1d":
            aggregatePeriod = 24 * 60 * 60;
            break;
    }

    data = aggregateData(data, aggregatePeriod);

    indicatorPreRoll = 33;
    if (data.length < 33) indicatorPreRoll = 0;

    x.domain(techan.scale.plot.time(data).domain());
    y.domain(techan.scale.plot.ohlc(data.slice(indicatorPreRoll)).domain());
    yPercent.domain(techan.scale.plot.percent(y, accessor(data[indicatorPreRoll])).domain());
    yVolume.domain(techan.scale.plot.volume(data).domain());

    macdData = techan.indicator.macd()(data);
    macdScale.domain(techan.scale.plot.macd(macdData).domain());
    rsiData = techan.indicator.rsi()(data);
    rsiScale.domain(techan.scale.plot.rsi(rsiData).domain());

    svg.select("g.candlestick").datum(data).call(candlestick);
    svg.select("g.volume").datum(data).call(volume);
    svg.select("g.sma.ma-0").datum(techan.indicator.sma().period(10)(data)).call(sma0);
    svg.select("g.sma.ma-1").datum(techan.indicator.sma().period(20)(data)).call(sma1);
    svg.select("g.ema.ma-2").datum(techan.indicator.ema().period(50)(data)).call(ema2);
    svg.select("g.macd .indicator-plot").datum(macdData).call(macd);
    svg.select("g.rsi .indicator-plot").datum(rsiData).call(rsi);

    zoomable.domain([indicatorPreRoll, data.length]);

    draw();
}

