function getLow(data, coord)
{
    var myData = $.grep(data, function(e){ return e.date == coord; });
    if (myData.length > 0) return myData[0].low;
    else return null;
}
function getHigh(data, coord)
{
    var myData = $.grep(data, function(e){ return e.date == coord; });
    if (myData.length > 0) return myData[0].high;
    else return null;
}
function getOpen(data, coord)
{
    var myData = $.grep(data, function(e){ return e.date == coord; });
    if (myData.length > 0) return myData[0].open;
    else return null;
}
function getClose(data, coord)
{
    var myData = $.grep(data, function(e){ return e.date == coord; });
    if (myData.length > 0) return myData[0].close;
    else return null;
}
function getWeightedAverage(data, coord) {
    var myData = $.grep(data, function (e) { return e.date == coord; });
    if (myData.length > 0) return myData[0].weightedAverage;
    else return null;
}
function getVolume(data, coord) {
    var myData = $.grep(data, function (e) { return e.date == coord; });
    if (myData.length > 0) return myData[0].volume;
    else return null;
}
function getQuotedVolume(data, coord) {
    var myData = $.grep(data, function (e) { return e.date == coord; });
    if (myData.length > 0) return myData[0].quoteVolume;
    else return null;
}

function zoomData(data, startDate)
{
    var newData = [];

    for (var i = 0; i < data.length; i++)
    {
        if (data[i].date >= startDate) newData.push(data[i]);
    }

    return newData;
}
function aggregateData(data, period) {
    var newData = [];

    if (data.length == 0) return tempData; //если передали пустой массив - не паримся

    var tempData = [];
    var thresholdDate = new Date(data[0].date.getTime() + period * 1000);

    for (var i = 0; i < data.length; i++) {
        if (data[i].date >= thresholdDate)
        {
            var totalVolume = sumVolumes(tempData);
            var totalQuotedVolume = sumQuotedVolumes(tempData);
            var averageAverage = sumWeightedAverages(tempData);
            newData.push(
                {
                    date: tempData[0].date,
                    open: tempData[0].open,
                    high: Math.max.apply(Math, tempData.map(function (e) { return e.high; })),
                    low: Math.min.apply(Math, tempData.map(function (e) { return e.high; })),
                    close: tempData[tempData.length - 1].close,
                    volume: totalVolume,
                    quoteVolume: totalQuotedVolume,
                    weightedAverage: averageAverage,
                }
            );
            tempData = [];
            thresholdDate = new Date(data[i].date.getTime() + period * 1000);
        }
	        
        tempData.push(data[i]);
    }

    return newData;
}
function sumVolumes(data)
{
    var value = 0;

    for (var i = 0; i < data.length; i++) {
        value += data[i].volume;
    }

    return value;
}
function sumQuotedVolumes(data) {
    var value = 0;

    for (var i = 0; i < data.length; i++) {
        value += data[i].quoteVolume;
    }

    return value;
}
function sumWeightedAverages(data) {
    var value = 0;

    for (var i = 0; i < data.length; i++) {
        value += data[i].weightedAverage;
    }

    return value / data.length;
}
